import React from "react";
import Background from "../../Assets/login-bg.jpg";

const Login = () => {
  return (
    <div
      className="login"
      style={{
        backgroundImage: `url(${Background})`,
        backgroundPosition: "center",
        backgroundSize: "cover",
        width: "100%",
        height: "100%",
        position: "fixed",
      }}
    >
      <div className="login-container"></div>
    </div>
  );
};

export default Login;
